  render() {
    return (
      <div>
        <MDBView src="">
            <MDBMask overlay="purple-light" className="flex-center flex-column text-white text-center">

            </MDBMask>
            </MDBView>
        <main>
          <MDBContainer className="text-center my-5"></MDBContainer>
        </main>
        <FooterPage />
      </div>
    );
  }
}

export default main;
